import ReactDOM from "react-dom";
import "./index.css"; // You can include global styles if needed
import Login from "./login/login"; // Importing the Login component from the login folder

const root = document.getElementById("root");

ReactDOM.render(
  <React.StrictMode>
    <Login />
  </React.StrictMode>,
  root
);
